import React, { useState, useEffect } from "react";
import { ImCross } from "react-icons/im";
import { Box, Button } from "@material-ui/core";
import axios from "axios";
import ReCAPTCHA from "react-google-recaptcha";
import useRazorpay from "react-razorpay";

const RequestToSpeak = ({ updateData, formName, currency, amount, Type }) => {
  const type = Type;
  let paymentRequestData = {};
  let response = {};
  const Razorpay = useRazorpay();
  const loadScript = (src) => {
    return new Promise((resolve) => {
      const script = document.createElement("script");
      script.src = src;
      document.body.appendChild(script);
      script.onload = () => {
        resolve(true);
      };
      script.onerror = () => {
        resolve(false);
      };
      document.body.appendChild(script);
    });
  };

  const postPayment = () => {
    if (response !== {}) {
      let info = axios({
        url: "https://gla-backend-new-dt4z.onrender.com/razorpay",
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin": "*",
        },
        data: JSON.stringify({
          response,
          firstName,
          lastName,
          email,
          phone,
          companyName,
          type,
          paymentRequestData,
        }),
      })
        .then((res) => {
          info = res.json();
        })
        .catch((err) => {});
    }
  };

  const failedPayments = () => {
    let info = axios({
      url: "https://gla-backend-new-dt4z.onrender.com/no-payments",
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": "*",
      },
      data: JSON.stringify({
        firstName,
        lastName,
        email,
        phone,
        companyName,
        type,
      }),
    })
      .then((res) => {
        info = res.json();
      })
      .catch((err) => {});
  };

  const intialValue = {
    firstName: "",
    lastName: "",
    email: "",
    companyName: "",
    phone: "",
    // passes: 0,
    // exhibition: "",
    address: "",
    type,
  };
  let [formValues, setFormValues] = useState(intialValue);
  const [formErrors, setFormErrors] = useState({});
  const [isSubmit, setIsSubmit] = useState(false);
  const [captcha, setCaptcha] = useState(false);

  const { firstName, lastName, email, companyName, phone } = formValues;

  const collectdata = async () => {
    if (
      firstName !== "" &&
      lastName !== "" &&
      email !== "" &&
      companyName !== "" &&
      captcha &&
      phone !== "" &&
      email.match(
        /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/
      )
    ) {
      formValues.type = Type;
      let info = axios({
        url: "https://gla-backend-new-dt4z.onrender.com/req-to-speak",
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin": "*",
        },
        data: JSON.stringify(formValues),
      })
        .then((res) => {
          info = res.json();
        })
        .catch((err) => {});
    } //   info =await info.json();
    // console.log(info, "info");
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setFormErrors(validate(formValues));
    setIsSubmit(true);
  };

  useEffect(() => {
    if (Object.keys(formErrors).length === 0 && isSubmit) {
      updateData();
    }
  }, [formErrors, formValues, isSubmit, updateData]);

  const validate = (values) => {
    const errors = {};
    const regex =
      /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    if (!values.firstName) {
      errors.firstName = "First Name is required";
    }
    if (!values.lastName) {
      errors.lastName = "Last Name is required";
    }

    if (!values.email) {
      errors.email = "Email is required";
    }
    if (!values.email.match(regex)) {
      errors.email = "Email is invalid";
    }
    if (!values.phone) {
      errors.phone = "Phone is required";
    }
    if (!values.companyName) {
      errors.companyName = "Company Name is required";
    }
    if (!captcha) {
      errors.captcha = "Please fill the Captcha";
    }

    return errors;
  };
  const handleCaptcha = () => {
    setCaptcha(!captcha);
  };

  return (
    <Box
      style={{
        width: "90% ",
        height: "70%",
        right: "5%",
        top: "4%",
        zIndex: 130,
        margin: "10% 0 0% 0",
        position: "fixed",
        backgroundColor: "#fff",
        borderRadius: "8px",
        boxShadow: "black 0px 3px 7px",
      }}
    >
      <Box
        sx={{
          textAlign: "center",
          fontSize: {
            xs: "11px",
            sm: "14px",
            md: "18px",
            lg: "20px",
            xl: "25px",
          },
          padding: {
            xs: "30px",
            sm: "25px",
            md: "10px",
          },
          fontWeight: "bold",
        }}
        style={{ textAlign: "center" }}
      >
        Global Legal Association is the sister concern of Effectual Knowledge
      </Box>

      <Box
        sx={{
          textAlign: "center",
          fontSize: {
            xs: "12px",
            sm: "14px",
            md: "17px",
            lg: "20x",
            xl: "22px",
          },
          fontWeight: "bold",
        }}
      >
        {formName}
      </Box>

      <div
        style={{
          border: "1px solid #e6e6e6",
          position: "absolute",
          right: "3%",
          top: "3%",
          zIndex: 100,
          padding: "10px 10px",
          cursor: "pointer",
          backgroundColor: "#fff",
          flexWrap: "wrap",
        }}
        onClick={updateData}
      >
        <ImCross scale={1} />
      </div>
      <form
        action=""
        style={{
          backgroundColor: "#fff",
          padding: "10px",
          display: "flex",
          flexDirection: "column",
          alignItems: "end",
        }}
        onSubmit={handleSubmit}
      >
        <Box
          style={{
            display: "flex",
            flexWrap: "wrap",
            justifyContent: "space-evenly",
          }}
        >
          <Box
            className="form-group"
            sx={{
              fontSize: {
                xs: "10px",
                sm: "13px",
                md: "16px",
                lg: "18px",
                xl: "20px",
              },
              width: "40%",
              marginBottom: "12px",
            }}
          >
            <label style={{ marginBottom: "0px" }} for="firstName">
              First Name
            </label>
            <input
              type="text"
              className="form-control"
              id="firstname"
              name="firstName"
              value={formValues.firstName}
              onChange={handleChange}
              style={{ height: "10px" }}
            />

            <Box
              sx={{
                color: "#FF2D55",
                fontSize: {
                  xs: "8px",
                  sm: "8px",
                  md: "10px",
                  lg: "12px",
                  xl: "15px",
                },
                whiteSpace: "nowrap",
              }}
            >
              {formErrors.firstName}
            </Box>
          </Box>
          <Box
            className="form-group"
            sx={{
              fontSize: {
                xs: "10px",
                sm: "13px",
                md: "16px",
                lg: "18px",
                xl: "20px",
              },
              width: "40%",
              marginBottom: "12px",
            }}
          >
            <label style={{ marginBottom: "0px" }} for="lastName">
              Last Name
            </label>
            <input
              type="text"
              className="form-control"
              id="lastName"
              name="lastName"
              value={formValues.lastName}
              onChange={handleChange}
              style={{ height: "10px" }}
            />
            <Box
              sx={{
                color: "#FF2D55",
                fontSize: {
                  xs: "8px",
                  sm: "8px",
                  md: "10px",
                  lg: "12px",
                  xl: "15px",
                },
                whiteSpace: "nowrap",
              }}
            >
              {formErrors.lastName}
            </Box>
          </Box>
          <Box
            className="form-group"
            sx={{
              fontSize: {
                xs: "10px",
                sm: "13px",
                md: "16px",
                lg: "18px",
                xl: "20px",
              },
              width: "40%",
              marginBottom: "12px",
            }}
          >
            <label style={{ marginBottom: "0px" }} for="email">
              E-mail Address
            </label>
            <input
              type="email"
              className="form-control"
              id="email"
              name="email"
              value={formValues.email}
              onChange={handleChange}
              style={{ height: "10px" }}
            />

            <Box
              sx={{
                color: "#FF2D55",
                fontSize: {
                  xs: "8px",
                  sm: "8px",
                  md: "10px",
                  lg: "12px",
                  xl: "15px",
                },
                whiteSpace: "nowrap",
              }}
            >
              {formErrors.email}
            </Box>
          </Box>
          <Box
            className="form-group"
            sx={{
              fontSize: {
                xs: "10px",
                sm: "13px",
                md: "16px",
                lg: "18px",
                xl: "20px",
              },
              width: "40%",
              marginBottom: "12px",
            }}
          >
            <label
              style={{ marginBottom: "0px", whiteSpace: "nowrap" }}
              for="companyName"
            >
              Organization
            </label>
            <input
              type="text"
              className="form-control"
              id="companyName"
              name="companyName"
              value={formValues.companyName}
              onChange={handleChange}
              style={{ height: "10px" }}
            />
            <Box
              sx={{
                color: "#FF2D55",
                fontSize: {
                  xs: "8px",
                  sm: "8px",
                  md: "10px",
                  lg: "12px",
                  xl: "15px",
                },
                whiteSpace: "nowrap",
              }}
            >
              {formErrors.companyName}
            </Box>
          </Box>
          <Box
            className="form-group"
            sx={{
              fontSize: {
                xs: "10px",
                sm: "13px",
                md: "16px",
                lg: "18px",
                xl: "20px",
              },
              width: "40%",
              marginBottom: "12px",
            }}
          >
            <label style={{ marginBottom: "0px" }} for="phone">
              Phone Number
            </label>
            <input
              type="number"
              className="form-control"
              id="phone"
              name="phone"
              value={formValues.phone}
              onChange={handleChange}
              style={{ height: "10px" }}
            />
            <Box
              sx={{
                color: "#FF2D55",
                fontSize: {
                  xs: "8px",
                  sm: "8px",
                  md: "10px",
                  lg: "12px",
                  xl: "15px",
                },
                whiteSpace: "nowrap",
              }}
            >
              {formErrors.phone}
            </Box>
          </Box>
          {/* <Box
              className="form-group"
              sx={{
                fontSize: {
                  xs: "10px",
                  sm: "13px",
                  md: "16px",
                  lg: "18px",
                  xl: "20px",
                },
                width: "40%",
                marginBottom: "12px"

              }}
            >
              <label  style={{marginBottom:"0px",whiteSpace: "nowrap"}} for="passes">Number of passes</label>
              <input type="number" className="form-control" id="passes" name="passes" value={formValues.passes} onChange={handleChange}
                  style={{height:"10px"}}
              />
              <Box sx={{
